    *   Interfaz para la gestión de clientes y productos (solo para el superusuario).
3.  *Base de Datos (Supabase):*
    *   Almacenamiento de usuarios, roles, clientes, productos y pedidos.
    *   Row Level Security (RLS) para controlar el acceso a los datos según el rol del usuario.

