Cliente: {cliente.nombre}\
"
    for producto in productos:
        resumen += f"- {producto.nombre}: {producto.cantidad}\
"
    resumen += f"Total: {pedido.total}"

    # Generar el enlace wa.me
    enlace_wa = f"https://wa.me/{cliente.telefono}?text={resumen}"

    return {"enlace_wa": enlace_wa}
